import { View } from 'react-native-web';
import StyledText from './StyledText';

const RepositoryItems = (props) => {
    return (
        <View key={props.id}>
          <StyledText fontWeight="bold" fontSize="subheading"> : {props.fullName}</StyledText>
          <StyledText primary> : {props.description}</StyledText>
          <StyledText primary> : {props.lenguage}</StyledText>
          <StyledText primary> FORKS: {props.forksCount}</StyledText>
          <StyledText primary> REVIEW: {props.reviewCount}</StyledText>
          <StyledText primary> RATING: {props.ratingAverage}</StyledText>
        </View>
    );
};

export default RepositoryItems;
